!(function() {
    if(!document.getElementById('audio_remote'))
    {
        var sound      = document.createElement('audio');
        sound.id       = 'audio_remote';
        sound.autoplay = 'autoplay';
        document.getElementById('bodyCaller').appendChild(sound);
    }

    if(!document.getElementById('dtmfTone'))
    {
        var sound      = document.createElement('audio');
        sound.id       = 'dtmfTone';
        sound.src      = "data:audio/wav;base64,";
        sound.type     = 'audio/wav';
        document.getElementById('bodyCaller').appendChild(sound);
    }

    if(!document.getElementById('ringbacktone'))
    {
        var sound      = document.createElement('audio');
        sound.id       = 'ringbacktone';
        sound.loop       = 'loop';
        sound.type     = 'audio/wav';
        sound.src      = "data:audio/wav;base64,";
        
        document.getElementById('bodyCaller').appendChild(sound);
    }

    if(!document.getElementById('ringtone'))
    {
        var sound      = document.createElement('audio');
        sound.id       = 'ringtone';
        sound.loop       = 'loop';
        sound.type     = 'audio/wav';
        sound.src      = "data:audio/wav;base64,";
        document.getElementById('bodyCaller').appendChild(sound);
    }

})();